@Elisha Ben Kimon, האזרח הקטן נאנק כיום תחת עול המסים. רק עכשיו מחיר העראק עלה. אין מספיק כסף לתרופות. המע"מ עלה בעוד אחוז. מחירי הדיור מאמירים והולכים... 
אבל הדבר החשוב ביותר לדעתך הוא החדשות המקומיות? אתה באמת מאמין בזה?? כל כסף שהמדינה גו(נ)בה מאיתנו נטען שהוא "לטובת האזרח", רק מה? אף פעם לא שואלים את האזרח.. אני האזרח ואני לא רוצה לתרום לחדשות המקומיות כסף.
רוצה צדקה? תקבץ נדבות. אני בכל אופן מעדיף לתרום את כספי לעניים, חסרי בית או חולים קשים.
